import React from "react";
import {Bar, BarChart, CartesianGrid, Legend, ResponsiveContainer, Tooltip, XAxis, YAxis} from "recharts";
import classes from "./Diagram.module.css";

const data = [
  {
    name: "Page A",
    uv: 4000,
    pv: 2400,
    amt: 2400
  },
  {
    name: "Page B",
    uv: 3000,
    pv: 1398,
    amt: 2210
  },
  {
    name: "Page C",
    uv: 2000,
    pv: 9800,
    amt: 2290
  },
  {
    name: "Page D",
    uv: 2780,
    pv: 3908,
    amt: 2000
  },
  {
    name: "Page E",
    uv: 1890,
    pv: 4800,
    amt: 2181
  },
  {
    name: "Page F",
    uv: 2390,
    pv: 3800,
    amt: 2500
  },
  {
    name: "Page G",
    uv: 3490,
    pv: 4300,
    amt: 2100
  }
];

export default function App() {
  return (
    <div className={classes.histogram}>
    <ResponsiveContainer >
      <BarChart
        width={1}
        height={1}
        data={data}
        margin={20}
      >
          <CartesianGrid strokeDasharray="3 3"/>
          <XAxis dataKey="name"/>
          <YAxis yAxisId="left" orientation="left" stroke="#808080"/>
          <YAxis yAxisId="right" orientation="right" stroke="#808080"/>
          <Tooltip/>
          <Legend/>
          <Bar yAxisId="left" dataKey="pv" fill="#FAA03E"/>
          <Bar yAxisId="right" dataKey="uv" fill="#74CD4D"/>
      </BarChart>
    </ResponsiveContainer>
    </div>
  );
}
